B.aXI=new A.bk("L'exp\xe9rience ce n'est pas ce qui nous arrive, c'est ce que nous faisons avec ce qui nous arrive.","","Aldous Huxley")
B.aXV=new A.bk("Le bonheur n'est pas une destination \xe0 atteindre, c'est une mani\xe8re de voyager.","","Margaret Lee Runbeck")
