B.aXK=new A.bk("Ne dites pas tout ce que vous pensez, mais pensez \xe0 tout ce que vous dites.","","Carlos Martinez Vazquez")
B.aXm=new A.bk("Quand un homme dit 'Je suis heureux', il veut tout bonnement dire 'J'ai des ennuis qui ne m'atteignent pas'.","","Jules Renard")
B.aXy=new A.bk("Tu ne peux pas emp\xeacher un oiseau de voler au-dessus de ta t\xeate. Par contre, tu peux l'emp\xeacher d'y \xe9tablir son nid.","","Auteur inconnu")
